def twoSum(numbers: list[int], target: int) -> list[int]:
    n = len(numbers)
    if n <= 1:
        return []

    start = 0
    while start < n - 1:
        if target - numbers[start] < numbers[start]:
            secondIndex = binarySearch(
                numbers, 0, start - 1, target - numbers[start])
            if secondIndex == -1:
                start += 1
            else:
                return [start + 1, secondIndex + 1]
        else:
            secondIndex = binarySearch(
                numbers, start + 1,  n - 1, target - numbers[start])
            if secondIndex == -1:
                start += 1
            else:
                return [start + 1, secondIndex + 1]

def binarySearch(arr, start, end, target):
    if start > end:
        return -1
    if arr[start] == target:
        return start
    if arr[end] == target:
        return end
    while start <= end:
        mid = start + ((end - start) // 2)
        if arr[mid] == target:
            return mid
        elif arr[mid] < target:
            start += 1
        else:
            end -= 1
    return -1


